import React, {Component} from 'react';

class YourName extends Component {
  render(){
    return (
      <div>
        안녕하세요! 제 이름은 <b>{this.props.name}</b>입니다.
      </div>
    );
  }
}
//defaultProps는 아래와 같은 형태로도 작성할 수 있습니다.
YourName.defaultProps = {
  name: '당신 이름'
};

export default YourName;
